  return (
    <div className='expenses-filter'>
      <div className='expenses-filter__control'>
        <label>Filter by year</label>
        <select>
          <option value='2022'onSubmit={onFilterDate()}>2022</option>
          <option value='2021'onSubmit={onFilterDate()}>2021</option>
          <option value='2020'onSubmit={onFilterDate}>2020</option>
          <option value='2019'onSubmit={onFilterDate}>2019</option>
        </select>
      </div>
    </div>
  );
};

